const DisDoggo = (props) => {
    return (
        <div id="dog-info">
            <img src={props.selectedDoggo.image} alt='cutie' />
            <h2>{props.selectedDoggo.name}</h2>
            <button onClick={handleClick()}>Good Doggo!</button>
        </div>
    )
}

export default DisDoggo
